import React from 'react';
import { AppBar, Avatar, Button, Toolbar, Typography } from '@material-ui/core';
import useStyles from './styles.js';
import { Link } from 'react-router-dom';

const Navbar = () => {
    const classes = useStyles();
    
    const setPosts = useSetRecoilState(p);
    const[curId,setId] = useRecoilValue(Id);
    
    useEffect(() => {
         const GetPosts = async() => {
    
            try {
                 var {data} = await api.fetchPosts();
                setPosts(data);
            } catch (error) {
                console.log(error);
            }
           
        }
        // const data = GetPosts();
        GetPosts();
        // const data =  GetPosts();
        // setPosts(data);

    }, [curId]);
    const user = null;
    return (
        <AppBar className={classes.appBar} position="static" color="inherit">
            <div className={classes.brandContainer}>
                <Typography component={Link} to='/' className = {classes.heading} variant="h2" align="center">Memories/Events</Typography>
                
            </div>
            <Toolbar className={classes.toolbar}>
                {user ? (
                    <div className={classes.profile}>
                        <Avatar className={classes.purple} alt = {user.result.name} src ={user.result.imageUrl}>
                            {user.result.name.charAt(0)}
                        </Avatar>
                        <Typography className={classes.userName} variant = 'h6'>{user.result.name}</Typography>
                        <Button variant = "contained" className={classes.logout} color = "secondary">Logout</Button>

                    </div>
                ) : (
                    <Button component = {Link} to= "/auth" variant = "contained" color = "primary" >Sign In</Button>    
                )
            }
            </Toolbar>
            </AppBar>
    )
}
export default Navbar
